import HeaderJobs from "./HeaderJobs.js";
import './MyJobs.css';





class MyJobs extends Component {
  render() {
    let myJobCount = 2;
    return (      
      <div className="myJobs">
      <div className="header-div">
      <HeaderJobs goToHome={this.goHome} goToMyJobs={this.goMyJobs}  page={"home"} myJobCount={myJobCount}/>
      </div>
      <div className="recommended-div">
      <div className="recommended-jobs-header">{"My Job Applications ("+myJobCount+")"}</div>
      </div>
      </div>


   );
  }
}

export default MyJobs;
